tr.td:
هذا الملف لا يمتلك معلومات معلومات المنتج، وربما تنقصه بعض المعلومات الأخرى.
يجب أن تحتوي الملفات على معلومات موجزة حول الملف لإعلام الآخرين بالمحتوى والمؤلف والمصدر والتاريخ إن أمكن. إذا كنت تعرف هذه المعلومات أو لديك إمكانية الوصول إليها، فيرجى إضافتها إلى صفحة الملف.
